//Take in player A,B's health and draw the corresponding number of blood on screen
void drawHeart(int A, int B){
  //printf("Entered drawHeart\n");
  for(int heartCount = 0; heartCount < A; heartCount++){
    for (int i=0; i<20; ++i) {
      for (int j=0; j<20; ++j) {
        if(blood[j*20+i] < 0xFF00)
            plot_pixel(0+heartCount*20+i, 0+j, blood[j * 20 + i]);
        }
    }
  }

  for(int heartCount = 0; heartCount < B; heartCount++){
    for (int i=0; i<20; ++i) {
      for (int j=0; j<20; ++j) {
        if(blood[j*20+i] < 0xFF00)
            plot_pixel(320-heartCount*20-i, 0+j, blood[j * 20 + i]);
        }
    }
  }
}
void clearHeart(int A, int B){
    for(int heartCount = 0; heartCount < A; heartCount++){
      for (int i=0; i<60; ++i) {
        for (int j=0; j<20; ++j) {
              plot_pixel(i, j, background[j * 320 + i]);
          }
      }
    }

    for(int heartCount = 0; heartCount < B; heartCount++){
      for (int i=260; i<320; ++i) {
        for (int j=0; j<20; ++j) {
              plot_pixel(i, j, background[j * 320 + i]);
          }
      }
    }
}

void update(struct point* P1, struct point* P2){




    if (P1->x>=32&&P1->x<=288&&P1->y>=32&&P1->y<=230){
        if (KEYBOARD_A){
        P1->x -= P1->dx;
        P1->face_left =true;
        P1->face_right =false;
        }
    else if(KEYBOARD_D){
        P1->x += P1->dx;
        P1->face_right = true;
        P1->face_left = false;
    }
    else if (KEYBOARD_W){
      //one can only jump after landed
      if(P1->falling == false)
        P1->jump = true;
    }
    else{
        P1->x +=0;
        P1->y +=0;
        }
    }
    if (P1->x<32){
    P1->x = 32;
    P1->y += 0;
    }
    if (P1->x>288){
    P1->x = 288;
    P1->y += 0;
    }
    if (P2->x>=32&&P2->x<=288&&P2->y>=32&&P2->y<=208){
        if (KEYBOARD_LEFT){
        P2->x -= P2->dx;
        P2->face_left =true;
        P2->face_right =false;
        }
    else if(KEYBOARD_RIGHT){
        P2->x += P2->dx;
        P2->face_right =true;
        P2->face_left =false;
    }
    else if (KEYBOARD_UP){
      if(P2->falling == false)
        P2->jump = true;
    }
    else{
        P2->x += 0;
        P2->y += 0;
        }
    }
    if (P2->x<32){
    P2->x = 32;
    P2->y += 0;
    }
    if (P2->x>288){
    P2->x = 288;
    P2->y += 0;
    }
    if(KEYBOARD_SPACE){
        P1->fire = true;
    }

    if(KEYBOARD_L){
        P2->fire = true;
    }

     KEYBOARD_UP = false;
     KEYBOARD_LEFT= false;
     KEYBOARD_RIGHT= false;
     KEYBOARD_RESTART= false;
     KEYBOARD_W= false;
     KEYBOARD_D= false;
     KEYBOARD_A= false;
     KEYBOARD_SPACE= false;
     KEYBOARD_L= false;


}

void wait_for_vsync() {
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020; // Buffer register
    register int status;

    *pixel_ctrl_ptr = 1; // start the synchronization process

    status = *(pixel_ctrl_ptr + 3);
    while ((status & 0x01) != 0) {
        status = *(pixel_ctrl_ptr + 3);
    }
}

void swap(int*x, int*y){
    int temp = *x;
    *x = *y;
    *y = temp;
}

void clear_screen() {
    int x;
    int y;
    for (x = 0; x < 320; x++)
        for (y = 0; y < 240; y++)
            plot_pixel(x, y, 0x0000);
}

void plot_pixel(int x, int y, short int line_color){
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

